import React, { Component } from 'react';


class ColerPicker extends Component {
  constructor(props){
    super(props);
    this.state = {
      colors : [
        'red'
      ]
    }

  }

  render() {
    return (
      <div className="control__color">
        <div className="title">
          Color picker
        </div>
        <div className="list">
          <span></span>
        </div>
      </div>
    );
  }

}

export default ColerPicker;
